import './App.css';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import {Head} from './components/common/Head';
import { Footer } from './components/common/Footer';

function App() {
  return (
    <>

    <Router>
      <Routes>
        <Head />
        <Footer />
      </Routes>
    </Router>

    </>
  );
}

export default App;
